import React, { Component } from 'react'
import Logo from './logo/Logo';
import { Link } from 'react-router-dom'
// import '../css/phone.css'

class PhoneNumberSMS extends Component {
    nextPage(e) {
        e.preventDefault();
        var that = this
        that.props.props.history.push('/phoneNumberNewPassword') // Переход на страницы  phoneNumberNewPassword
    }
    render() {
        return (
            <div className="forform">
                <Logo />
                <div>
                    <div >
                        <form onSubmit={this.nextPage.bind(this)} id="phoneNumberSMS">
                            <input className="button-my button-big-my button-gray" type="text" required placeholder="Введите код полученный в SMS"
                                title="код состоит из 4-х символов" pattern="^[0-9]{4}" />
                        </form>
                    </div>

                    <div>
                        <button type="submit" className="button-my button-big-my button-red" form="phoneNumberSMS">Далее</button>
                    </div>
                </div>
            </div>
        )
    }
}

export default PhoneNumberSMS
